import React from 'react'
import './Home.css';
import homeimg from '../Images/c4.jpg';
const Home = () => {
  let menu={
    background:`linear-gradient(rgba(0,0,0,0.5),rgba(0,0,0,0.5)),url(${homeimg})`,
    backgroundSize: "cover"
  }
  let manicolor={
    color:"blue"
  }
  return (
    <div>
      <div className="menu" style={menu}>
        <h4 style={manicolor}>Saniya</h4>
      </div>
    </div>
  )
}

export default Home
